import React from 'react';
import { LogoContainer, LogoText, LogoImage, LogoWrapper } from './styles';
import penguinLogo from '../../assets/images/penguin-logo.svg';

const Logo: React.FC = () => {
  return (
    <LogoContainer>
      <LogoWrapper>
        <LogoImage src={penguinLogo} alt="Pinguim Verde" />
        <LogoText>
          Drive <span>Vale-Sis</span>
        </LogoText>
      </LogoWrapper>
    </LogoContainer>
  );
};

export default Logo;
